  \"2015-01-22T15:57:34.603364\",\n\t\"name\": \"esg-grantee-areas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Emergency Shelter Grants (ESG) program
  is designed to identify sheltered and unsheltered homeless persons, as well as those
  at risk of homelessness, and provide the services necessary to help those persons
  quickly regain stability in permanent housing after experiencing a housing crisis
  and/or homelessness. The ESG is a non-competitive formula grant awarded to recipients
  which are state governments, large cities, urban counties, and U.S. territories.
  Recipients make these funds available to eligible sub-recipients, which can be either
  local government agencies or private nonprofit organizations. The recipient agencies
  and organizations, which actually run the homeless assistance projects, apply for
  ESG funds to the governmental grantee, and not directly to HUD.\",\n\t\"license_title\":
